import React from "react";
import styled from "styled-components";

const Busy = styled.div`
    height: 15px;
    width: ${({ duration }) => `${duration}%` };
    color: red;
`

const Turnaround = styled.div`
    height: 15px;
    width: ${({ duration }) => `${duration}%` };
    color: purple;
`

const Free = styled.div`
    height: 15px;
    width: ${({ duration }) => `${duration}%` };
    color: green;
`

// 1440 min -> 24 hours
const Timeline = () => {
    const test = [
        {
            type: "busy",
            duration: 440,
        },
        {
            type: "turnaround",
            duration: 15,
        },
        {
            type: "free",
            duration: 985,
        }
    ];

    return (
    <div>
        {
        test.map((segment) => {
            if (segment.type === "busy") return (<div>busy</div>);
            if (segment.type === "turnaround") return (<div>turnaround</div>);
            if (segment.type === "free") return (<div>free</div>);
        })
        }
    </div>
    )
}

export default Timeline;
